const ManagerType = Loader(lazy(() => import('./content/pages/Components/ManagerType')));
const PlaceOfBirth = Loader(lazy(() => import('./content/pages/Components/PlaceOfBirth')));
const Role = Loader(lazy(() => import('./content/pages/Components/Role')));
const RoleAccess = Loader(lazy(() => import('./content/pages/Components/RoleAccess')));
const ShareHolder = Loader(lazy(() => import('./content/pages/Components/Share-holder')));
const ShareHolderType = Loader(lazy(() => import('./content/pages/Components/Share-holderType')));
const IDType = Loader(lazy(() => import('./content/pages/Components/IDType')));
const Director = Loader(lazy(() => import('./content/pages/Components/Director')));
const Manager = Loader(lazy(() => import('./content/pages/Components/Manager')));
const Client = Loader(lazy(() => import('./content/pages/Components/Client')));
const Agent = Loader(lazy(() => import('./content/pages/Components/Agent')));
const Company = Loader(lazy(() => import('./content/pages/Components/Company')));

// Status

const Status404 = Loader(lazy(() => import('./content/pages/Status/Status404')));
const Status500 = Loader(lazy(() => import('./content/pages/Status/Status500')));
const StatusComingSoon = Loader(lazy(() => import('./content/pages/Status/ComingSoon')));
const StatusMaintenance = Loader(lazy(() => import('./content/pages/Status/Maintenance')));

