const routes = (isLoggedIn) => [
  {
    path: 'login',
    element: <BaseLayout />,
    children: [
      {
            path: '',
            element: <Login />
      },
      {
        path: 'login',
        element: (
          <Navigate
                to="/login"
            replace
          />
        )
        },
        
      {
        path: 'status',
        children: [
          {
            path: '',
            element: (
              <Navigate
                to="404"
                replace
              />
            )
          },
          {
            path: '404',
            element: <Status404 />
          },
          {
            path: '500',
            element: <Status500 />
          },
          {
            path: 'maintenance',
            element: <StatusMaintenance />
          },
          {
            path: 'coming-soon',
            element: <StatusComingSoon />
          },
        ]
      },
      {
        path: '*',
        element: <Status404 />
      },
    ]
  },
  {
    path: '*',
      element: (isLoggedIn ?
          <SidebarLayout /> : <Navigate
              to="/login"
              replace
          />
      ),
    children: [
      {
        path: '',
            element: <Main />
      },
    ]
  },
  {
      path: 'management',
      element: (isLoggedIn ? 
          <SidebarLayout /> : <Navigate
              to="/login"
              replace
          />
    ),
    children: [
      {
        path: '',
        element: (
          <Navigate
            to="/management/client"
            replace
          />
        )
      },
      {
          path: 'client',
          element: <Client />
        },
        {
            path: 'company',
            element: <Company />
        },
        {
            path: 'shareholder',
            element: <ShareHolder />
        },
        {
            path: 'director',
            element: <Director />
        },
        {
            path: 'agent',
            element: <Agent />
        },
        {
            path: 'manager',
            element: <Manager />
        },
    ]
    },
  
  {
    path: 'masters',
      element: (isLoggedIn ?
          <SidebarLayout /> : <Navigate
              to="/login"
              replace
          />
      ),
    children: [
      {
        path: '',
        element: (
          <Navigate
            to="/masters/buttons"
            replace
          />
        )
      },
        {
            path: 'companytype',
            element: <CompanyType />
        },
      {
          path: 'designation',
          element: <Designation />
      },
      {
          path: 'directortype',
          element: <DirectorType />
      },
      {
          path: 'nationality',
          element: <Nationality />
      },
      {
          path: 'placeofbirth',
          element: <PlaceOfBirth />
      },
      {
          path: 'managerType',
          element: <ManagerType />
      },
      {
          path: 'shareholdertype',
          element: <ShareHolderType />
      },
      {
          path: 'idtype',
          element: <IDType />
      },
    ]
  },
    {
        path: 'security',
        element: (isLoggedIn ?
            <SidebarLayout /> : <Navigate
                to="/login"
                replace
            />
        ),
        children: [
            {
                path: '',
                element: (
                    <Navigate
                        to="/components/users/userstable"
                        replace
                    />
                )
            },
            {
                path: 'user',
                element: <User />
            },
            {
                path: 'role',
                element: <Role />
            },
            {
                path: 'roleaccess',
                element: <RoleAccess />
            },
        ]
    },
];

